import React, { Component } from 'react'

export default class Message extends Component {
  render() {
    return (
      <div>
        <ul>
          {
            messageArr.map((msgObj) => {
              return (
                <li key={msgObj.id}>
                  <a href="/xxxxxxx">{msgObj.title}</a>&nbsp;
                </li>
              )
            })
          }
        </ul>
      </div>
    )
  }
}
